  return (
    <div>
      <h3> Welcome </h3>
      <small> Let's get your finances in order. </small>
      <p>You are not signed in. Click here to sign in.</p>
      <button id="loginButton">Login with Google</button>
      <h4>
        <Link to="/users">Users</Link>
      </h4>
    </div>
  );
};

export default MainPage;
